libs.content:
find_library(${mylibrary}
    names
        ${mylibraryname}
    paths
        ${osg_dir}
        $env{osg_build_dir}
        $env{osg_dir}
        $env{osgdir}
        $env{osg_root}
        $env{osg}
        ~/library/frameworks
        /library/frameworks
        /usr/local
        /usr
        /sw
        /opt/local
        /opt/csw
        /opt
        [hkey_local_machine\\system\\currentcontrolset\\control\\session\ manager\\environment;osg_root]/lib
        /usr/freeware
    path_suffixes
        /lib/
        /lib64/
        /build/lib/
        /build/lib64/
        /build/lib/
        /build/lib64/
     )

find_library(openthreads_library 
    names openthreads openthreadswin32 
    paths
    $env{openthreads_library_dir}
    $env{openthreads_dir}/lib64
    $env{openthreads_dir}/lib
    $env{openthreads_dir}
    $env{osg_library_dir}
    $env{osg_dir}/lib64
    $env{osg_dir}/lib
    $env{osg_dir}
    no_default_path
)

find_library(openthreads_library 
        names openthreads openthreadswin32 
        paths ${cmake_prefix_path} 
        path_suffixes lib64 lib
    )

find_library(openthreads_library_debug 
    names openthreadsd openthreadswin32d
    paths
    $env{openthreads_debug_library_dir}
    $env{openthreads_library_dir}
    $env{openthreads_dir}/lib64
    $env{openthreads_dir}/lib
    $env{openthreads_dir}
    $env{osg_library_dir}
    $env{osg_dir}/lib64
    $env{osg_dir}/lib
    $env{osg_dir}
    ${cmake_prefix_path}/lib64
    ${cmake_prefix_path}/lib
    ${cmake_prefix_path}
    no_default_path
)

find_library(openthreads_library_debug 
        names openthreadsd openthreadswin32d
        paths ${cmake_prefix_path} 
        path_suffixes lib64 lib
    )

find_library(webp_library_release names webp libwebp_a libwebp
             hints "${webp_dir}"
             path_suffixes "${path_suffixes}" ${library_path_suffixes}
			)

find_library(webp_library_debug names webp_debug libwebp libwebp_a libwebp
             hints "${webp_dir}"
             path_suffixes "${path_suffixes}" ${library_path_suffixes} 
			)

find_library("${depname}_library" 
    names ${library}
  paths 
)

find_library(filegdb_library filegdbapi
    names filegdbapi
    paths ${filegdb_dir}
    path_suffixes /lib64/ /lib/
)

find_library(filegdb_library_debug filegdbapid
    names filegdbapid
    paths ${filegdb_dir}
    path_suffixes /lib64/ /lib/
)
